import React from 'react';
import './App.css';
import FooterComponent from './components/FooterComponent';
import HeaderComponent from './components/HeaderComponent';
import ListCustomerComponent from './components/ListCustomerComponent';
import { Route, Switch}from 'react-router-dom'
import CreateCustomerComponent from './components/CreateCustomerComponent';
import UpdateCustomerComponent from './components/UpdateCustomerComponent';
import ViewCustomerComponent from './components/ViewCustomerComponent';
import ListFlightComponent from './components/ListFlightComponent';

function App() {
  return (
    <div> 

          < HeaderComponent/>
            <div className="container">
              <Switch>
                <Route exact path="/" component={ListFlightComponent}/>
                <Route path="/customers" component={ListCustomerComponent}/> 
                <Route path="/add-customer" component={CreateCustomerComponent}/>
                <Route path="/update-customer/:id" component={UpdateCustomerComponent}/>
                <Route path="/view-customer/:id" component={ViewCustomerComponent}/>
                <Route path="/flights" component={ListFlightComponent}/>
              </Switch>
            </div>
          <FooterComponent/>

    </div>
  );
}

export default App;
